import { StatusBar } from 'expo-status-bar';
import { Alert, StyleSheet, Text, TouchableNativeFeedback, TouchableWithoutFeedbackComponent, View } from 'react-native';

export default function App() {
  return (
    <View style={styles.container}>
      <TouchableWithoutFeedbackComponent onPress={() => Alert.alert('Hola juan')} >
        <Text style={styles.Text}>Hola Youtuber</Text>
      </ TouchableWithoutFeedbackComponent>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
  Text: {
    color: '#000'

  }
});
